primes <- function(n) {
  if (n >= 1) {
    prime_nums <- 2
    num <- 3
    while (length(prime_nums) < n) {
      if (all(num %% prime_nums != 0)) {
        prime_nums <- c(prime_nums, num)
      }
      num <- num + 2
    }
    return(prime_nums)
  } else {
    return(integer(0))
  }
}

