primes <- function(n) {
  if (n >= 2) {
    x <- 2:n
    primes <- c()
    while (length(x) > 0) {
      primes <- c(primes, x[1])
      x <- x[(x %% x[1]) != 0]
    }
    return(primes)
  } else {
    return(NULL)
  }
}

